import './App.css';
import Home from './components/home/home.component';
import { Provider, useSelector } from 'react-redux'
import { PersistGate } from 'redux-persist/integration/react'
import { BrowserRouter, Routes, Route } from "react-router-dom";
import {store, persistor} from './redux/store'
import selectBmiCategory from './redux/slices/bmiSlice';
import BMIRecomendation from './components/bmi-recomendations/bmi-recomendation.component';

const App = () => (

    <Provider store={store}>
      <PersistGate loading={null} persistor={persistor}>
        <BrowserRouter>
          <Routes>
            <Route path="/" element={<Home/>}>
              <Route index element={<Home/>}/>
              <Route path={`category/${useSelector(selectBmiCategory)}`} element={<BMIRecomendation/>}/>
            </Route>
          </Routes>
        </BrowserRouter>
      </PersistGate>
    </Provider>

);
export default App;
